svg.script:
	
			
			var endInterval = 0
			
			var rot1_1 = 0, rot1_2 = 185, rot1_3 = 135, rot1_4 = 0, rot1_5 = 20;
			var rot2_1 = 0, rot2_2 = 175, rot2_3 = 125, rot2_4 = 20, rot2_5 = 50;	
			var rot3_1 = 0, rot3_2 = 50, rot3_3 = -20, rot3_4 = 120, rot3_5 = 0;	
			var rot4_1 = 0;
			var rot5_1 = 0;
			
			var opac = 0, opac2 = 1, opac3 = 0;
			
			var fast_ = 50, fast_2 = 50, fast_3 = 50, fast_4 = 50, fast_5 = 50, fast_6 = 50, fast_7 = 50;

			var rota = 0;			
			var aniPoints = 0;
			
			var nextStep = false;
			
			var endAnimation = false;	
			
			var main_obj = document.getElementById("main_obj");
			var leaver_1 = document.getElementById("leaver_1");
			var leaver_2 = document.getElementById("leaver_2");
			var cap_obj = document.getElementById("cap_obj");
			
			var shine1 = document.getElementById("shine1");
			var shineGradient = document.getElementById("maskObj1")
			var shine2 = document.getElementById("shine2");
			var shineGradient2 = document.getElementById("maskObj2")
			
			var obj3 = document.getElementById("obj3");
			
			var noLoop = true;

			
			var Interval = null;
			
			function startAnimation() {
				if(Interval == null) {
					Interval = setInterval(animate, 20);
				}
			}
			
			function stopAnimation() {
				if(Interval != null){
					clearInterval(Interval);
					Interval = null;
				}
			}	
			
			function animate() {		
				
				rota = rota + 1;				
				aniPoints = aniPoints +1;
				
				if(noLoop){
				
					if(aniPoints > 10 && aniPoints < 40){
						endAnimation = false;
						fast_ += (2 - fast_)/7;
						rot1_1 += (rot1_2 - rot1_1)/fast_;
						leaver_1.setAttribute("transform",  "translate(0 "+ rot1_1 +")");
						
						opac += (1 - opac)/fast_;	
						leaver_1.setAttribute("opacity",  opac);
					}
					
					
					if(aniPoints > 20 && aniPoints < 60){
						fast_2 += (2 - fast_2)/7;				
						rot2_1 += (rot2_2 - rot2_1)/fast_2;
						leaver_2.setAttribute("transform",  "translate( 0 "+ rot2_1 +")");
						opac += (1 - opac)/fast_2;	
						leaver_2.setAttribute("opacity",  opac);
					}
					
					
					if(aniPoints > 40 && aniPoints < 70){		

						fast_3 += (2 - fast_3)/10;		
						rot1_1 += (rot1_3 - rot1_1)/fast_3;				
						leaver_1.setAttribute("transform",  "translate(0 "+ rot1_1 +")");
					}
					
					if(aniPoints > 60 && aniPoints < 90){
						fast_4 += (2 - fast_4)/10;					
						rot2_1 += (rot2_3 - rot2_1)/fast_4;
						leaver_2.setAttribute("transform",  "translate( 0 "+ rot2_1 +")");
						
						rota = rota +1;
					}
					
					if(aniPoints > 80 && aniPoints < 120){
						fast_5 += (2 - fast_5)/5;					
						rot3_1 += (130 - rot3_1)/fast_5;					
						main_obj.setAttribute("transform",  "translate( 155 "+ rot3_1 +")");
						opac3 += (1 - opac3)/fast_5;	
						main_obj.setAttribute("opacity",  opac3);
					}
				
				}
				
				if(!noLoop){
					if(aniPoints > 20 && aniPoints < 120){
						
						if(aniPoints > 20 && aniPoints < 60){
							fast_6 += (2 - fast_6)/20;					
							rot4_1 += (90 - rot4_1)/fast_6;
							shineGradient.setAttribute("transform",  "translate( "+ rot4_1 +", 0 )");
						}
						if(aniPoints > 50 && aniPoints < 120){
							fast_7 += (2 - fast_7)/20;					
							rot5_1 += (90 - rot5_1)/fast_7;
							shineGradient2.setAttribute("transform",  "translate( "+ rot5_1 +", 0 )");
							
						}
						endAnimation = false;
					}
				}
				
				if(aniPoints > 140 && !endAnimation){
					endAnimation = true;
					aniPoints = 0;
					noLoop = false;
					shineGradient.setAttribute("transform",  "translate( "+ 0 +", 0 )");
					shineGradient2.setAttribute("transform",  "translate( "+ 0 +", 0 )");
					rot4_1 = 0, rot5_1 = 0;
					fast_ = 50, fast_2 = 50, fast_3 = 50, fast_4 = 50, fast_5 = 50, fast_6 = 50, fast_7 = 50;					
				}
				
			}
			
			main_obj.setAttribute("transform",  "translate( 155, 0)");
			main_obj.setAttribute("opacity",  "0");
			leaver_1.setAttribute("opacity",  "0");
			leaver_2.setAttribute("opacity",  "0");
			
			shine1.setAttribute("transform",  "translate( 14, 134 )");			
			shine2.setAttribute("transform",  "translate( 140, 142)");
			
			startAnimation();
